Oliebollen are a variety of dumpling made by using an ice cream scoop or two spoons to scoop a certain amount of dough and dropping the dough into a deep fryer filled with hot oil. In this way, a sphere-shaped oliebol emerges. Oliebollen are traditionally eaten on New Year's Eve and at funfairs.
